import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { useDispatch, useSelector } from "react-redux";
import { register } from "../actions/auth";
import { useNavigate } from 'react-router-dom';

const Signup = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [successful, setSuccessful] = useState(false);
  const { message } = useSelector(state => state.message);
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const handleSignup = (e) => {
    e.preventDefault();


    dispatch(register(email, password, confirmPassword))
    .then(() => {
        debugger
        setSuccessful(true);
    })
    .catch((error) => {
        debugger
        setSuccessful(false);
    });
  };

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="card">
            <div className="card-body">
              <div className="logo text-center mx-auto mb-3">
                <a href="#">
                  <img src="images/logo.png" className="img-fluid mx-auto" width="300" alt="Your Logo" />
                </a>
              </div>
              <h3 className="card-title text-center">Sign Up</h3>
              <form onSubmit={handleSignup}>
                <div className="mb-3">
                  <label htmlFor="email" className="form-label">
                    Email
                  </label>
                  <input
                    type="email"
                    className="form-control"
                    id="email"
                    placeholder="Enter your email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    required
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="password" className="form-label">
                    Password
                  </label>
                  <input
                    type="password"
                    className="form-control"
                    id="password"
                    placeholder="Enter your password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    required
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="confirmPassword" className="form-label">
                    Confirm Password
                  </label>
                  <input
                    type="password"
                    className="form-control"
                    id="confirmPassword"
                    placeholder="Confirm your password"
                    value={confirmPassword}
                    onChange={(e) => setConfirmPassword(e.target.value)}
                    required
                  />
                </div>
                {message && (
                  <div className="form-group">
                    <div className="alert alert-danger" role="alert">
                      {message}
                    </div>
                  </div>
                )}
                {message && successful && (
                  <div className="form-group">
                    <div className="alert alert-success" role="alert">
                      Registration completed
                    </div>
                  </div>
                )}
                <div className="mb-4">
                  <input type="submit" value="Sign Up" className="btn btn-primary w-100" />
                </div>
                <div className="text-center">
                  <div className="or-text mb-3 grey-txt text-uppercase">
                    <span className="border rounded d-inline-block px-2">Or</span>
                  </div>
                  <a href="#">Log In</a>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );  
};

export default Signup;
